import React from 'react';
import './nav.css';

function Nav(props) {
  const linkTitle = props.value;
  const linkTitles = linkTitle.map((number) =>
    <li className='nav-link' key={number}>
        {number}
        {console.log(number.toString())}
    </li>
  );

  return (
    <div className="navbar">
        <ul className="nav">
          {linkTitles}
        </ul>
      </div>
  );
}

export default Nav;
